function getMakeable() {
    let skip = typeof makeable === "undefined" ? new Set() : new Set(makeable);
    let canMake = new Set();
    function check(element) {
        if (!element) return;
        if (skip.has(element)) return;
        if (Array.isArray(element)) element.forEach((elem) => check(elem));
        else if (!canMake.has(element)) {
            if (element.match(/molten_/)) return;
            canMake.add(element);
        }
    }
    for (let element in elements) {
        let data = elements[element];
        if (data.reactions) {
        Object.values(data.reactions).forEach(r => {
            check(r.elem1);
            check(r.elem2);
        })
        }
        check(data.stateHigh);
        check(data.stateLow);
        check(data.breakInto);
        check(data.alias);
    }
    check(["lamp_oil","propane","molten_plastic"]);
    console.log(JSON.stringify([...canMake]));
}

